INSERT INTO `config_info` VALUES (1, 'boot-datasource.yml', 'DEFAULT_GROUP', 'spring: \n  datasource:\n    type: com.zaxxer.hikari.HikariDataSource\n    driver-class-name: com.mysql.cj.jdbc.Driver\n    url: jdbc:mysql://${application-datasource-jdbc-url:maozi-cloud-mysql:3306}/${application-datasource-db-name:${spring.application.name}-${project.environment}-db}?useSSL=false&serverTimezone=UTC&characterEncoding=utf8&nullCatalogMeansCurrent=true\n    username: ${application-datasource-jdbc-username:root}\n    password: ${application-datasource-jdbc-password:password}\n    hikari:\n      maximum-pool-size: 12\n      connection-timeout: 6000\n      minimum-idle: 12\n      idle-timeout: 500000\n      max-lifetime: 540000\n      connection-test-query: SELECT 1', 'dc5da53bbaeeca4580a4c3e3d596b545', '2023-02-20 01:04:02', '2024-01-02 10:36:21', 'nacos', '172.30.0.1', '', '', '', '', '', 'yaml', '');
