INSERT INTO `config_info` VALUES (5, 'boot-redis.yml', 'DEFAULT_GROUP', 'spring: \n  redis: \n    enabled: true\n    host: maozi-cloud-redis\n    port: 6379\n    password: 812840531zhang\n    lettuce:\n      shutdown-timeout: 300ms\n      pool:\n        max-active: 600\n        max-wait: 1000\n        max-idle: 300\n        min-idle: 0\n    timeout: 60000\n#    cluster:\n#      nodes: \n#        - 192.168.1.111:7001\n#        - 192.168.1.112:7001\n#        - 192.168.1.110:7002\n#        - 192.168.1.110:7001\n#        - 192.168.1.111:7002\n#        - 192.168.1.112:7001', '4669634a728122c667f292386545ec6a', '2023-02-20 01:04:02', '2024-01-02 15:27:37', 'nacos', '172.30.0.1', '', '', '', '', '', 'yaml', '');
INSERT INTO `config_info` VALUES (6, 'boot-seata.yml', 'DEFAULT_GROUP', 'spring:\n  cloud:\n    alibaba:\n      seata:\n        # 自定义事务组名称 tx_group，需要与服务端一致\n        tx-service-group: tx-group\n\nseata:\n  enabled: true\n  application-id: ${spring.application.name}\n  tx-service-group: tx-group\n  service:\n   vgroup-mapping:\n     tx-group: tx-group\n  config:\n    type: nacos\n    nacos:\n      namespace: public\n      serverAddr: localhost:8848\n      group: SEATA_GROUP\n      username: nacos\n      password: nacos\n  registry:\n    type: nacos\n    nacos:\n      application: seata-server\n      server-addr: localhost:8848\n      group : SEATA_GROUP\n      namespace: public\n      username: nacos\n      password: nacos', 'cc49ebc81b7592d60a884d0a8f643155', '2023-02-20 01:04:02', '2023-02-20 01:04:02', NULL, '172.21.0.1', '', '', NULL, NULL, NULL, 'yaml', NULL);
