INSERT INTO `config_info` VALUES (33, 'cloud-sentinel.yml', 'DEFAULT_GROUP', 'resttemplate:\n  sentinel:\n    enabled: true\n\nfeign:\n  sentinel: \n    enabled: true\n\nspring: \n  cloud: \n    sentinel:\n      eager: true\n      transport:\n        port: 8081\n        dashboard: localhost:8080\n      datasource:\n        flow:\n          nacos:\n            server-addr: ${spring.cloud.nacos.config.server-addr}\n            groupId: SENTINEL_GROUP\n            dataId: ${spring.application.name}-flow-rules\n            rule-type: flow\n        degrade:\n          nacos:\n            server-addr: ${spring.cloud.nacos.config.server-addr}\n            groupId: SENTINEL_GROUP\n            dataId: ${spring.application.name}-degrade-rules\n            rule-type: degrade\n        param-flow:\n          nacos:\n            server-addr: ${spring.cloud.nacos.config.server-addr}\n            groupId: SENTINEL_GROUP\n            dataId: ${spring.application.name}-param-rules\n            rule-type: param-flow\n        system:\n          nacos:\n            server-addr: ${spring.cloud.nacos.config.server-addr}\n            groupId: SENTINEL_GROUP\n            dataId: ${spring.application.name}-system-rules\n            rule-type: system\n        authority:\n          nacos:\n            server-addr: ${spring.cloud.nacos.config.server-addr}\n            groupId: SENTINEL_GROUP\n            data-id: ${spring.application.name}-authority-rules\n            rule-type: authority', '02c39b4372ec78575d3b850a3ae0d030', '2023-02-20 01:04:02', '2023-02-20 01:04:02', NULL, '172.21.0.1', '', '', NULL, NULL, NULL, 'yaml', NULL);
