INSERT INTO `config_info` VALUES (94, 'maozi-etc-sentinel.yml', 'DEFAULT_GROUP', '#spring settings\nspring.http.encoding.force=true\nspring.http.encoding.charset=UTF-8\nspring.http.encoding.enabled=true\n#server.port=9000\n\n#cookie name setting\nserver.servlet.session.cookie.name=sentinel_dashboard_cookie\n\n#logging settings\nlogging.level.org.springframework.web=INFO\nlogging.file=${user.home}/logs/csp/sentinel-dashboard.log\nlogging.pattern.file= %d{yyyy-MM-dd HH:mm:ss} [%thread] %-5level %logger{36} - %msg%n\n#logging.pattern.console= %d{yyyy-MM-dd HH:mm:ss} [%thread] %-5level %logger{36} - %msg%n\n\n#auth settings\nauth.filter.exclude-urls=/,/auth/login,/auth/logout,/registry/machine,/version\nauth.filter.exclude-url-suffixes=htm,html,js,css,map,ico,ttf,woff,png\n# If auth.enabled=false, Sentinel console disable login\nauth.username=sentinel\nauth.password=sentinel\n\n# Inject the dashboard version. It\'s required to enable\n# filtering in pom.xml for this resource file.\nsentinel.dashboard.version=${project.version}\n\n\n\n\n\n\n\n\n\n\n\n\nspring.datasource.driver-class-name=com.mysql.jdbc.Driver\nspring.datasource.url=\nspring.datasource.username=\nspring.datasource.password=\n\n# spring data jpa\nspring.jpa.hibernate.ddl-auto=none\nspring.jpa.hibernate.use-new-id-generator-mappings=false\nspring.jpa.database-platform=org.hibernate.dialect.MySQLDialect\nspring.jpa.show-sql=false\n', '29789c2a9b259d55f95b3f2b0f44a498', '2023-02-20 01:04:02', '2023-02-20 01:04:02', NULL, '172.21.0.1', '', '', NULL, NULL, NULL, 'yaml', NULL);
INSERT INTO `config_info` VALUES (95, 'maozi-etc-user-mq-consume.yml', 'DEFAULT_GROUP', 'application-port: 60000\n\napplication-project-name: user-mq-consume\n\n\n\nspring:\n  cloud:\n    stream:\n      rocketmq: \n      # BindingProperties \n        bindings:\n          maozi-log-topic: {consumer.orderly: true}\n      bindings: { \n\n        maozi-log-topic: {\n          destination: maozi-log-topic, \n          content-type: text/plain, \n          group: maozi-log-group,\n          # RocketMQConsumerProperties \n          consumer.maxAttempts: 3,\n          }\n\n         }\n  \n\n        \n\n\n', '5e5444a0dafe52d05d0cb7d7a0314df2', '2023-02-20 01:04:02', '2023-02-20 01:04:02', NULL, '172.21.0.1', '', '', NULL, NULL, NULL, 'yaml', NULL);
INSERT INTO `config_info` VALUES (100, 'saas-code.json', 'DEFAULT_GROUP', '{\n    \"maozi-cloud-base-code\": {\n        \"1\": {\n            \"code\": 1,\n            \"message\": \"\"\n        },\n        \"2\": {\n            \"code\": 2,\n            \"message\": \"服务没有此code\"\n        },\n        \"3\": {\n            \"code\": 3,\n            \"message\": \"Token错误\"\n        },\n        \"6\": {\n            \"code\": 6,\n            \"message\": \"服务未启动\"\n        },\n        \"7\": {\n            \"code\": 7,\n            \"message\": \"更新失败\"\n        },\n        \"8\": {\n            \"code\": 8,\n            \"message\": \"添加失败\"\n        },\n        \"9\": {\n            \"code\": 9,\n            \"message\": \"删除失败\"\n        },\n        \"10\": {\n            \"code\": 10,\n            \"message\": \"分页参数错误\"\n        },\n        \"11\": {\n            \"code\": 11,\n            \"message\": \"游客\"\n        },\n        \"12\": {\n            \"code\": 12,\n            \"message\": \"验签失败\"\n        },\n        \"13\": {\n            \"code\": 13,\n            \"message\": \"验证失败\"\n        },\n        \"14\": {\n            \"code\": 14,\n            \"message\": \"字段全部为空\"\n        },\n        \"16\": {\n            \"code\": 16,\n            \"message\": \"重复提交错误\"\n        },\n        \"17\": {\n            \"code\": 17,\n            \"message\": \"未找到第三方接口转换器\"\n        },\n        \"18\": {\n            \"code\": 18,\n            \"message\": \"未找到第三方数据请求转换器\"\n        },\n        \"400\": {\n            \"code\": 400,\n            \"message\": \"参数错误\"\n        },\n        \"401\": {\n            \"code\": 401,\n            \"message\": \"用户未授权\"\n        },\n        \"402\": {\n            \"code\": 402,\n            \"message\": \"恶意请求\"\n        },\n        \"403\": {\n            \"code\": 403,\n            \"message\": \"权限不足\"\n        },\n        \"404\": {\n            \"code\": 404,\n            \"message\": \"没有此资源\"\n        },\n        \"405\": {\n            \"code\": 405,\n            \"message\": \"请求格式错误\"\n        },\n        \"415\": {\n            \"code\": 415,\n            \"message\": \"请求格式错误\"\n        },\n        \"500\": {\n            \"code\": 500,\n            \"message\": \"内部服务错误\"\n        },\n        \"600\": {\n            \"code\": 600,\n            \"message\": \"错误熔断\"\n        },\n        \"601\": {\n            \"code\": 601,\n            \"message\": \"限流中\"\n        },\n        \"700\": {\n            \"code\": 700,\n            \"message\": \"网关错误\"\n        },\n        \"800\": {\n            \"code\": 800,\n            \"message\": \"获取Token失败\"\n        }\n    },\n    \"maozi-cloud-test-service-test-code\":{\n        \"3001\":{\n            \"code\":3001,\n            \"message\":\"测试测试\"\n        }\n    },\n    \"maozi-cloud-test-service-test-enums\":{\n\n        \"test-enums\":[{\n            \"key\": 0,\n            \"value\": \"test11\"\n        },{\n            \"key\": 1,\n            \"value\": \"test22\"\n        }]\n        \n    },\n    \"maozi-cloud-sso-service-oauthToken-rpc-code\":{\n        \"1001\":{\n            \"code\":1001,\n            \"message\":\"client无效\"\n        },\n        \"1002\":{\n            \"code\":1002,\n            \"message\":\"用户或密码错误\"\n        }\n    }\n}', 'd6eeafb40fe45564f55754adc9b9a69e', '2023-02-20 01:04:02', '2023-06-11 08:32:20', 'nacos', '172.18.0.1', '', '', '', '', '', 'json', '');
INSERT INTO `config_info` VALUES (102, 'maozi-cloud-gateway.yml', 'DEFAULT_GROUP', 'project:\n  title: 网关服务\n  details: 处理 流量分发、黑白名单、流控 等功能\n\napplication-port: ${application-dev-port:10000}\n\napplication-project-name: gateway\n\nknife4j:\n  gateway:\n    enabled: true\n    strategy: discover\n    discover:\n      version: openapi3\n      enabled: true\n      excluded-services:\n        - dubbo.*\n        - maozi-cloud-monitor\n\nspring: \n  cloud:\n    sentinel:\n      filter:\n        enabled: false\n      datasource:\n        gw-flow:\n          nacos:\n            server-addr: ${spring.cloud.nacos.config.server-addr}\n            dataId: ${spring.application.name}-gw-flow\n            groupId: SENTINEL_GROUP\n            rule-type: gw-flow\n        gw-api-group:\n          nacos:\n            server-addr: ${spring.cloud.nacos.config.server-addr}\n            dataId: ${spring.application.name}-gw-api-group\n            groupId: SENTINEL_GROUP\n            rule-type: gw-api-group\n    gateway:\n      discovery:\n        locator:\n          enabled: true\n\n\n      default-filters:\n      - StripPrefix=1\n      - name: Retry\n        args:\n          retries: 1\n          methods: GET,POST\n          statuses: BAD_GATEWAY,GATEWAY_TIMEOUT,SERVICE_UNAVAILABLE\n          series: INFORMATIONAL\n          exceptions: java.net.ConnectException,org.springframework.cloud.gateway.support.NotFoundException\n\n\n      routes: \n        - id: MAOZI-CLOUD-SYSTEM\n          uri: lb://maozi-cloud-system\n          predicates:\n          - Path=/system/**\n\n        - id: MAOZI-CLOUD-OAUTH\n          uri: lb://maozi-cloud-oauth\n          predicates:\n          - Path=/oauth/**\n          # filters:\n          #- StripPrefix=1\n          # - WSProtocolFilter\n\n      # default-filters:\n      #   - name: Hystrix\n      #     args:\n      #       name: default\n      #       #转发地址\n      #       fallbackUri: \'forward:/fallback\'\n      #   - name: Retry\n      #     args:\n      #       #重试次数，默认值是 3 次\n      #       retries: 3\n      #       #HTTP 的状态返回码\n      #       statuses: BAD_GATEWAY,BAD_REQUEST\n      #       #指定哪些方法的请求需要进行重试逻辑，默认值是 GET 方法\n      #       methods: GET,POST', 'efdfdf29993f8af665df7ace985689b3', '2023-02-20 01:04:02', '2024-01-20 11:09:25', 'nacos', '172.30.0.1', '', '', '', '', '', 'yaml', '');
